import React from 'react';
import logo from '../images/india_climate.gif';

function IndiaClimate() {
  return (
    <div style={{ height: '100%' }}>
      <img
        src={logo}
        alt='india climate'
        style={{ height: '100%', width: '100%' }}
      />
    </div>
  );
}

export default IndiaClimate;
